    "benton-lake-wetland-management-district-annual-narrative-report-calendar-year-1981",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Benton Lake Wetland
    Management District outlines Refuge accomplishments during the 1981 calendar year.
    The report begins with an introduction to the Refuge and information about weather
    conditions, habitat conditions, land acquisition activities, and the system status.
    Construction and maintenance are also described. Habitat management is covered;
    croplands, grasslands, wetlands, forests, wilderness areas, and easements for waterfowl
    management are discussed. The wildlife section of the report discusses endangered
    species, migratory birds, mammals, and non-migratory birds. Interpretation and recreation
    activities are outlined; topics include fishing, hunting, and law enforcement. Field
    investigations, cooperative programs, items of interest, and safety information
    are attached",nt"license_title": "License Not Specified",nt"extras":
